import React from 'react'
import { Link, useNavigate } from 'react-router-dom';
import '../styles/Home.css';
import HomeContainer from './HomeContainer';
import Layout from './Layout';


const Home = () => {
  const navigate = useNavigate();
  const goLoginPage = () => {
    navigate('/login');
  }

  return (
    <Layout>
      <HomeContainer />
    </Layout>
  )
}

export default Home
